/**
 * yyyi.imageモジュール
 */
YYYI.image = (function(){
  _image_base64 = {
    1: "data:image/jpeg;base64,",
    2: "data:image/jpeg;base64,",
    3: "data:image/jpeg;base64,",
    4: "data:image/jpeg;base64,",
    5: "data:image/jpeg;base64,",
    6: "data:image/jpeg;base64,",
    7: "data:image/jpeg;base64,",
    8: "data:image/jpeg;base64,",
    9: "data:image/jpeg;base64,",
    10: "data:image/jpeg;base64,",
    11: "data:image/jpeg;base64,",
    12: "data:image/jpeg;base64,",
    13: "data:image/jpeg;base64,",
    14: "data:image/jpeg;base64,",
    15: "data:image/jpeg;base64,",
    16: "data:image/jpeg;base64,",
    17: "data:image/jpeg;base64,",
    18: "data:image/jpeg;base64,",
    19: "data:image/jpeg;base64,",
    20: "data:image/jpeg;base64,",
    21: "data:image/jpeg;base64,",
    22: "data:image/jpeg;base64,",
    23: "data:image/jpeg;base64,",
    24: "data:image/jpeg;base64,"
  }

  /**
   * キャラクター画像のパスを返す。
   * @param {String} キャラクターID
   * @param {String} 原作ID
   * @param {Number} 画像サイズ
   * @return キャラクター画像パス
   */
  getImgSrc = function(name, origin, size) {
    return "image/jpg" + size + "/" + ("00" + origin).slice(-2) + "/" + ("00" + name).slice(-2) + ".jpg";
  }

  /**
   * キャラクター画像のbase64化文字列を返す。
   * @param {String} キャラクターID
   * @return base64化文字列
   */
  getImgBase64 = function(name) {
    return _image_base64[name];
  }

  return {
    getImgSrc: getImgSrc,
    getImgBase64: getImgBase64
  }
}());
